import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import NewExercise from "./Searchable";

function NewExercisePage({ options, addNewExercise }) {
    const navigate = useNavigate();
    const [selectedExercise, setSelectedExercise] = useState("");

    function handleExerciseSelection(exerciseName) {
        addNewExercise(exerciseName);
        navigate("/"); // Navigate back to the main page
    }

    return (
        <div>
            <h2>Select a New Exercise</h2>
            <NewExercise
                options={options}
                label="name"
                id="id"
                selectedVal={selectedExercise}
                handleChange={setSelectedExercise}
                addNewExercise={handleExerciseSelection}
            />
        </div>
    );
}

export default NewExercisePage;
